"text": "<div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\nHelena Eriksdotterin tiedot on merkitty pieleen heti alusta alkaen ja korjattu vasta <br />\npuolen vuosisadan p\u00e4\u00e4st\u00e4, ilmeisesti miehen Johan Henrikssonin kuoleman yhteydess\u00e4.<br />\nOikea syntym\u00e4p\u00e4iv\u00e4 on 22.3.1751, lastenkirjaan 1762-1771 on merkitty 1754 ja t\u00e4m\u00e4 <br />\nv\u00e4\u00e4r\u00e4 tieto on kopioitu eteenp\u00e4in kunnes vihdoin korjattu rippikirjassa 1803-1812.\n</p>\n</div>\n</div>",
